import React from 'react';
import PlanetCard from './PlanetCard'

const Content = ({planets}) => {
    return (
        <div>
            <PlanetCard name={planets[0].name} climate={planets[0].climate} gravity={planets[0].gravity} terrain={planets[0].terrain} />
        </div>
    );
}

export default Content;
